import * as React from 'react';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import { Box } from '@mui/material';
import { Stack } from '@mui/system';
import Pagination from '@mui/material/Pagination';
export default function Feed() {
  const y= (x)=>{
    if(x<600) return 2;
    else  return 4;
  }
  var width = window.innerWidth;
  return (
    <Box flex={5}  >
    <ImageList 
      cols={y(width)}
    >
        <ImageListItem key={itemData[0].img} sx={{position:"relative"}}>
          <img
            src={`${itemData[0].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[0].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[0].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[0].title}
            subtitle={<span>by: {itemData[0].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
        <ImageListItem key={itemData[1].img}>
          <img
            src={`${itemData[1].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[1].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[1].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[1].title}
            subtitle={<span>by: {itemData[1].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
        <ImageListItem key={itemData[2].img}>
          <img
            src={`${itemData[2].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[2].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[2].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[2].title}
            subtitle={<span>by: {itemData[2].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
        <ImageListItem key={itemData[3].img}>
          <img
            src={`${itemData[3].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[3].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[3].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[3].title}
            subtitle={<span>by: {itemData[3].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
        <ImageListItem key={itemData[4].img}>
          <img
            src={`${itemData[4].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[4].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[4].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[4].title}
            subtitle={<span>by: {itemData[4].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
        <ImageListItem key={itemData[0].img}>
          <img
            src={`${itemData[0].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[0].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[0].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[0].title}
            subtitle={<span>by: {itemData[0].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
        <ImageListItem key={itemData[0].img}>
          <img
            src={`${itemData[0].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[0].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[0].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[0].title}
            subtitle={<span>by: {itemData[0].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
        <ImageListItem key={itemData[0].img}>
          <img
            src={`${itemData[0].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[0].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[0].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[0].title}
            subtitle={<span>by: {itemData[0].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
        <ImageListItem key={itemData[0].img}>
          <img
            src={`${itemData[0].img}?w=248&fit=crop&auto=format`}
            srcSet={`${itemData[0].img}?w=248&fit=crop&auto=format&dpr=2 2x`}
            alt={itemData[0].title}
            loading="lazy"
          />
          <ImageListItemBar
            title={itemData[0].title}
            subtitle={<span>by: {itemData[0].author}</span>}
            position="below"
          />
        </ImageListItem>

        {/*----------*/}
    </ImageList>
    <Stack spacing={2}>
      <Pagination count={10} />
      <Pagination count={10} color="primary" />
      <Pagination count={10} color="secondary" />
      <Pagination count={10} disabled />
    </Stack>
    </Box>
  );
}

const itemData = [
  {
    img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
